  "tests/test_dataset_and_code_score.py": "import unittest\n\nfrom src.metrics.dataset_and_code import DatasetAndCodeMetric\n\n\nclass TestDatasetAndCodeMetric(unittest.TestCase):\n\n    def setUp(self):\n        self.metric = DatasetAndCodeMetric()\n\n    def test_initialization(self):\n        self.assertEqual(self.metric.score, 0.0)\n        self.assertEqual(self.metric.latency, 0.0)\n\n    def test_get_description(self):\n        test_data = {\"description\": \"Test description\"}\n        result = self.metric.get_description(test_data)\n        self.assertEqual(result, \"Test description\")\n\n        result = self.metric.get_description({})\n        self.assertEqual(result, \"\")\n\n    def test_ml_integration_detection(self):\n        test_data = {\"tags\": [\"transformers\", \"pytorch\"]}\n        result = self.metric.ml_integration(test_data)\n        self.assertTrue(result)\n\n        test_data = {\"pipeline_tag\": \"text-classification\"}\n        result = self.metric.ml_integration(test_data)\n        self.assertTrue(result)\n\n        test_data = {\"tags\": [\"other\", \"random\"]}\n        result = self.metric.ml_integration(test_data)\n        self.assertFalse(result)\n\n    def test_score_calculation(self):\n        test_data = {\n            \"category\": \"MODEL\",\n            \"description\": (\n                \"A comprehensive description that is long enough to get good \" \"documentation score\"\n            ),\n            \"example_count\": 0,\n            \"licenses\": \"apache-2.0\",\n            \"ml_integration\": True,\n            \"engagement\": {\"downloads\": 15000, \"likes\": 150},\n            \"has_documentation\": True,\n            \"has_code_examples\": True,\n            \"tags\": [],\n            \"card_data\": {},\n            \"downloads\": 15000,\n            \"likes\": 150,\n        }\n\n        self.metric.calculate_score(test_data)\n\n        self.assertGreater(self.metric.dataset_and_code_score, 0.5)\n        self.assertLessEqual(self.metric.dataset_and_code_score, 1.0)\n",
  "tests/test_dataset_quality.py": "import unittest\n\nfrom src.metrics.dataset_quality import DatasetQualityMetric\n\n\nclass TestDatasetQualityMetric(unittest.TestCase):\n    def setUp(self):\n        self.metric = DatasetQualityMetric()\n\n    def test_initialization(self):\n        self.assertEqual(self.metric.score, 0.0)\n        self.assertEqual(self.metric.latency, 0.0)\n\n    def test_example_count_extraction(self):\n        test_data = {\n            \"category\": \"DATASET\",\n            \"cardData\": {\n                \"dataset_info\": {\n                    \"splits\": [\n                        {\"name\": \"train\", \"num_examples\": 1000},\n                        {\"name\": \"test\", \"num_examples\": 200},\n                    ]\n                }\n            },\n        }\n\n        result = self.metric.get_example_count(test_data)\n        self.assertEqual(result, 1200)\n\n    def test_metadata_completeness(self):\n        test_data = {\n            \"cardData\": {\n                \"task_categories\": [\"text-classification\"],\n                \"language\": [\"en\"],\n                \"size_categories\": [\"1K<n<10K\"],\n                \"source_datasets\": [\"original\"],\n            }\n        }\n\n        result = self.metric.get_metadata_completeness(test_data)\n        self.assertAlmostEqual(result, 4 / 6, places=2)\n\n    def test_non_dataset_returns_zero(self):\n        test_data = {\"category\": \"MODEL\"}\n        data = self.metric.get_data(test_data)\n        self.assertIsNone(data)\n",
